import React from 'react';
import { Layout } from 'antd';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/navbar';

function App() {
	return (
		<Router>
			<Layout>
				<Navbar />
			</Layout>
		</Router>
	);
}

export default App;
